import React from 'react';

import './styles.css';

function DistanceResult({ distance, duration }) {
    return (
        <ul className="distance-item">
        <header>
          <div className="user-info">
            <strong>
              <p>Distance: {distance}</p>
              <p>Duration: {duration}</p>
            </strong>
          </div>
        </header>
      </ul>
    )
}

export default DistanceResult;
